import React, { useState } from 'react';
import TaskModal from './TaskModal';
import './AssignedToMe.css';

const AssignedToMe = () => {
  const [isModalOpen, setModalOpen] = useState(false);
  const [showSettings, setShowSettings] = useState(false);

  // Task ekleme modalƒ±nƒ± a√ßma ve kapama
  const handleModalOpen = () => {
    setModalOpen(true);
  };

  const handleModalClose = () => {
    setModalOpen(false);
  };

  // ... d√ºƒümesine tƒ±klanƒ±nca ayarlarƒ± a√ßma/kapama
  const toggleSettings = () => {
    setShowSettings(!showSettings);
  };

  return (
    <div className="assigned-to-me card">
      <div className="header">
        <h2>Assigned to me</h2>
        <div className="header-icons">
          <button className="icon-button" title="Add task" onClick={handleModalOpen}>
            <span role="img" aria-label="add-task">‚ûï</span>
          </button>
          <button className="icon-button" title="Expand" onClick={() => console.log('Expand')}>
            ‚õ∂
          </button>
          <div className="dropdown">
            <button className="icon-button" title="More" onClick={toggleSettings}>
              ‚ãÆ
            </button>
            {showSettings && (
              <div className="dropdown-content">
                <button className="remove-button" onClick={() => console.log('Remove card')}>üóëÔ∏è Remove card</button>
              </div>
            )}
          </div>
        </div>
      </div>

      {/* Eƒüer modal a√ßƒ±ksa task ekleme modali g√∂r√ºn√ºr */}
      <TaskModal isOpen={isModalOpen} onClose={handleModalClose} />

      <div className="empty-state">
        <span role="img" aria-label="check" className="checkmark">‚úîÔ∏è</span>
        <p>Tasks assigned to you will appear here. <a href="#">Learn more</a></p>
        <button className="add-task-button" onClick={handleModalOpen}>+ Add task</button>
      </div>
    </div>
  );
};

export default AssignedToMe;
